import React from 'react';
import {  Button, Checkbox, Icon, List, Table } from 'semantic-ui-react';
import '../../../../app/layout/DashboardLayout/styles.css';
import { IBrand } from '../../../../app/models/brand';
import { ISector } from '../../../../app/models/sector';
interface IProps {
  brands: IBrand[];
  // selectActivity: (id: string) => void;
  // deleteActivity: (id: string) => void;
}

const BrandList: React.FC<IProps> = ({
  brands
  // selectActivity,
  // deleteActivity
}) => {
  return (
    <div>
      <Table celled inverted selectable>
        <Table.Header fullWidth >
          <Table.Row  >
            <Table.HeaderCell>Brand Name</Table.HeaderCell>
            <div className="th">
            <Table.HeaderCell>Options</Table.HeaderCell>

            </div>
          </Table.Row>
        </Table.Header>

        <Table.Body>
          {brands.map((brand) => (
            <Table.Row positive key={brand.brandId}>
              <Table.Cell >{ brand.brandName}</Table.Cell>
              <Table.Cell colSpan="2">
                <Button.Group floated="right">
                  <Button>Edit</Button>
                  <Button.Or />
                  <Button negative>Delete</Button>
                </Button.Group>
              </Table.Cell>
            </Table.Row>
          ))}
        </Table.Body>

        <Table.Footer fullWidth>
          <Table.Row>
            <Table.HeaderCell colSpan="15">
              <Button
                floated="right"
                icon
                labelPosition="left"
                primary
                size="small"
              >
                <Icon name="stripe s" /> Add Brand
              </Button>
            </Table.HeaderCell>
          </Table.Row>
        </Table.Footer>
      </Table>
    </div>
  );
};

export default BrandList;
